import React from 'react';
import Navbar from '../components/Navbar';
import Footer from '../components/Footer';
import GrievanceList from '../components/GrievanceList';

const Admin = () => {
  return (
    <div>
      <Navbar />
      <h1>Admin Dashboard</h1>
      <GrievanceList />
      <Footer />
    </div>
  );
};

export default Admin;
